import styled from "styled-components"

const Wrapper = styled.div`
    height:300px;
    justify-content:center;
    align-items:center;
    display:flex;
`

const ErrorTable = () => (
    <Wrapper >
        <h1>Error</h1>
    </Wrapper>
)


export default ErrorTable
